///////////////////////////////////////////////////////////////////////////////
export const TYPES = {
  CONFIG_RESPONSE: "CONFIG_RESPONSE",
};

export const actions = {};

export const reducer = (
  state = {
    visible: false,
    cda: false,
  },
  action
) => {
  switch (action.type) {
    case TYPES.CONFIG_RESPONSE:
      return { ...state, cda: action.payload.cda };
    default:
      return state;
  }
};
